  false,\n\t\"url\": null,\n\t\"notes\": \"This is an Arc/Info coverage consisting
  of 4 arcs representing the retaining walls (non-historic) at Pipe Spring National
  Monument, Arizona. The walls were collected by a Trimble GeoXT GPS unit with external
  antenna, Hurricane, and post processed in GPS Pathfinder Office 3.0 for differential
  corrections. The location of the walls is approximate. The walls, of course, is
  underground. It was GPS'd by walking in areas of disturbed vegetation and from directions
  for the Maintenance Supervisor, Terry Strong. This feature is referenced by the
  2000 National Register of Historic Places, Nomination Update (August 14, 2000).
  Located on the map: Pipe Spring National Monument Historic District (prepared by:
  Kathy McKoy, NPS, June 2000 detail; revised Existing Conditions map, Landscape Systems,
  1997). It is a noncontributing feature.\",\n\t\"license_title\": null,\n\t\"extras\":
